import React from 'react';
import Button from '@mui/material/Button'


type ButtonComponentType = {
    name: string;
    started: () => void;
    disabled?: boolean;
}

export const ButtonComponent = (props:ButtonComponentType) => {



    return (
        <div>
         <Button   onClick={props.started} variant="contained">
             {props.name}
         </Button>
        </div>
    );
};
